INSERT INTO `san_pham` VALUES (77, 'Áo sơ mi tay kiểu Sleeves', 100000, 200000, NULL, 'Hoàng đẹp trai vcl.', '2024-10-15', 50, 7, NULL, NULL, NULL, NULL, 'Ghi khói', NULL);
INSERT INTO `san_pham` VALUES (78, 'Áo sơ mi Tencel Blossom', 369000, 400000, 'Mang đậm vẻ đẹp tinh tế và thanh thoát, áo sơ mi Tencel Blossom là lựa chọn hoàn hảo cho nàng công sở hiện đại yêu thích phong cách nhẹ nhàng, nữ tính nhưng vẫn đầy thanh lịch.', 'Áo sơ mi mang đến một diện mạo mới mẻ, hiện đại trong phong cách thời trang công sở. Với thiết kế ôm vừa vặn, áo giúp tôn lên những đường nét cơ thể, tạo nên vẻ ngoài thon gọn và tinh tế cho người mặc. Chất liệu cao cấp cùng đường may tỉ mỉ, áo sơ mi không chỉ mang lại sự thoải mái mà còn thể hiện gu thẩm mỹ sang trọng, chuyên nghiệp. Dễ dàng kết hợp với nhiều loại trang phục khác nhau, áo sơ mi trở thành sự lựa chọn hoàn hảo cho những ai muốn thể hiện phong cách lịch lãm và tự tin nơi công sở.', '2024-10-15', 221, 7, NULL, NULL, NULL, NULL, 'Trắng', NULL);
INSERT INTO `san_pham` VALUES (79, 'Áo sơ mi lụa tay dài Grace', 599000, 799000, 'Tinh tế và thanh lịch, áo sơ mi Grace là một thiết kế hoàn hảo dành cho những cô nàng yêu thích phong cách thời trang sang trọng nhưng không kém phần dịu dàng. Được làm từ chất liệu lụa cao cấp, áo mang đến cảm giác mềm mại,', 'Áo sơ mi mang đến một diện mạo mới mẻ, hiện đại trong phong cách thời trang công sở. Với thiết kế ôm vừa vặn, áo giúp tôn lên những đường nét cơ thể, tạo nên vẻ ngoài thon gọn và tinh tế cho người mặc. Chất liệu cao cấp cùng đường may tỉ mỉ, áo sơ mi không chỉ mang lại sự thoải mái mà còn thể hiện gu thẩm mỹ sang trọng, chuyên nghiệp. Dễ dàng kết hợp với nhiều loại trang phục khác nhau, áo sơ mi trở thành sự lựa chọn hoàn hảo cho những ai muốn thể hiện phong cách lịch lãm và tự tin nơi công sở.', '2024-10-15', 130, 7, NULL, NULL, NULL, NULL, 'Trắng ngà', NULL);
INSERT INTO `san_pham` VALUES (80, 'Áo sơ mi Lụa Muse', 590000, 799000, 'Tinh tế và thanh lịch, áo sơ mi Grace là một thiết kế hoàn hảo dành cho những cô nàng yêu thích phong cách thời trang sang trọng nhưng không kém phần dịu dàng. Được làm từ chất liệu lụa cao cấp, áo mang đến cảm giác mềm mại,', 'Ánh nắng mùa thu, dù không còn chói chang, vẫn mang đến cảm giác ấm áp, nhẹ nhàng tựa như sự mềm mại và lãng mạn luôn hiện hữu bên trong mỗi người phụ nữ. Đây chính là nguồn cảm hứng chủ đạo cho những thiết kế tinh tế trong BST Muse of the Sun.\n\nÁo sơ mi Lụa Muse mang vẻ ngoài nhẹ nhàng, không quá cầu kì trong thiết kế nhưng khi diện lên lại toát nên sự sang trọng, vô cùng tinh tế. \n\nThiết kế tạo điểm nhấn kim tuyến phần viền cổ và túi giả, một chút đặc biệt đủ để áo trở nên nổi bật, gây ấn tượng ngay từ cái nhìn đầu tiên.\n\nChất liệu lụa mềm mại, kết hợp dáng tay dài thanh thoát giúp người mặc có trải nghiệm thoải mái cũng như thích hợp với tiết trời thu sang.', '2024-10-15', 340, 7, NULL, NULL, NULL, NULL, 'Đen', NULL);
INSERT INTO `san_pham` VALUES (81, 'Áo Polo Daily', 499000, 599000, 'Tinh tế và thanh lịch, áo sơ mi Grace là một thiết kế hoàn hảo dành cho những cô nàng yêu thích phong cách thời trang sang trọng nhưng không kém phần dịu dàng. Được làm từ chất liệu lụa cao cấp, áo mang đến cảm giác mềm mại,', 'Áo polo thời trang nữ linh hoạt và thoải mái. Thiết kế cổ đức có khuy cài, gấu tay bo nhẹ. \n\nÁo được làm từ chất liệu thun co giãn nhẹ, thoáng khí với đường may chắc chắn, tỉ mỉ tạo nên vẻ bền bỉ và chất lượng.\n\nDễ dàng kết hợp với nhiều kiểu quần như jean, chino hoặc chân váy, tạo nên phong cách thời trang xu hướng. ', '2024-10-15', 132, 8, NULL, NULL, NULL, NULL, 'Be', NULL);
INSERT INTO `san_pham` VALUES (82, 'Áo thun A la More', 299000, 499000, 'Tinh tế và thanh lịch, áo sơ mi Grace là một thiết kế hoàn hảo dành cho những cô nàng yêu thích phong cách thời trang sang trọng nhưng không kém phần dịu dàng. Được làm từ chất liệu lụa cao cấp, áo mang đến cảm giác mềm mại,', 'Áo được làm từ chất liệu cotton, giúp mang lại sự thoải mái và mềm mại cho người mặc.\n\nÁo thun cổ tròn, tay ngắn, dáng suông. Phần cổ áo được nhấn viền khác màu kết hợp chữ cùng họa tiết bắt mắt trên thân trước. \n\nThiết kế dễ dàng phối hợp với nhiều loại quần, từ jeans đến shorts, tạo ra những outfits phù hợp cho nhiều dịp khác nhau.', '2024-10-15', 84, 8, NULL, NULL, NULL, NULL, 'Đen', NULL);
INSERT INTO `san_pham` VALUES (83, 'Áo thun viền cổ tay ren', 399000, 599000, 'Áo thun cổ tròn, tay ngắn, độ dài thường, dáng suông cơ bản', 'Áo thun cổ tròn, tay ngắn, độ dài thường, dáng suông cơ bản. \nÁo có màu trắng, tạo điểm tương phản nổi bật qua đường viền cổ sắc nét. Tay áo tạo điểm nhấn qua chi tiết phối ren độc đáo, mới lạ.\nÁo có thể mix cùng nhiều kiểu quần, chân váy khác nhau phù hợp với phong cách thời trang riêng mỗi người. ', '2024-10-15', 89, 8, NULL, NULL, NULL, NULL, 'Trắng', NULL);
INSERT INTO `san_pham` VALUES (84, 'Áo khoác len kẻ', 400000, 590000, '', 'Thêm chút hiện đại qua kiểu dáng trẻ trung sẽ tạo nên phiên bản hoàn hảo cho chiếc áo len Thu - Đông năm nay. Áo khoác dáng suông, tay dài, đan len phối hai màu tươi sáng. Bạn có thể kết hợp áo với nhiều kiểu quần và chân váy khác nhau. Nếu thời tiết lạnh chỉ cần thêm một áo khoác ngoài là đã có ngay một set đồ xuống phố.  ', '2024-10-15', 56, 10, NULL, NULL, NULL, NULL, 'Kẻ cam đất', NULL);
INSERT INTO `san_pham` VALUES (85, 'Áo khoác len kẻ', 299000, 300000, '', 'Thêm chút hiện đại qua kiểu dáng trẻ trung sẽ tạo nên phiên bản hoàn hảo cho chiếc áo len Thu - Đông năm nay. Áo khoác dáng suông, tay dài, đan len phối hai màu tươi sáng. Bạn có thể kết hợp áo với nhiều kiểu quần và chân váy khác nhau. Nếu thời tiết lạnh chỉ cần thêm một áo khoác ngoài là đã có ngay một set đồ xuống phố.  ', '2024-10-15', 54, 10, NULL, NULL, NULL, NULL, 'Kẻ xanh dương đậm', NULL);
INSERT INTO `san_pham` VALUES (86, 'Áo khoác Tweed cổ V Flare', 400000, 430000, '', 'Áo khoác Flare là thiết kế IVY moda lựa chọn cho những cô nàng yêu thích phong cách thanh lịch, sang trọng nhưng vẫn giữ được sự mềm mại, nữ tính trong mùa Thu Đông tới đây.\n\nVới chất liệu tweed dày dặn, cao cấp, chiếc áo không chỉ thích hợp với thời tiết giao mùa mà còn giữ được form dáng hoàn hảo, tạo nên vẻ ngoài tinh tế và thời thượng.\n\nThiết kế cổ V thanh thoát bên cạnh dáng suông ngắn đã tạo nên tổng thể hài hòa, đảm bảo tính thoải mái. Áo dễ dàng kết hợp với váy bút chì, quần jeans hoặc quần tây, để tạo nên nhiều phong cách khác nhau, từ công sở chuyên nghiệp đến dạo phố ngày thường. ', '2024-10-15', 43, 11, NULL, NULL, NULL, NULL, 'Kẻ trắng ngà', NULL);
INSERT INTO `san_pham` VALUES (87, 'Áo khoác Tweed Elegance', 400000, 400000, '', 'Kết hợp giữa phong cách cổ điển và hiện đại, chiếc Áo khoác Elegance mang lại vẻ ngoài sang trọng, thanh lịch. Chất liệu tweed có kết cấu dày dặn, là lựa chọn lý tưởng cho những ngày thu đông, giúp bạn vừa giữ ấm vừa nổi bật cùng phong cách thời thượng.\n\nThiết kế cổ đức cổ điển bên cạnh dáng suông thoải mái mang đến sự chỉn chu, tinh tế. Độ dài áo ngang hông tạo cảm giác gọn gàng, hiện đại, rất dễ phối với nhiều trang phục khác nhau. Họa tiết kẻ sọc hai tông màu đen trắng nổi bật, hứa hẹn đi đầu xu hướng thời trang Thu Đông năm nay. \n\nÁo khoác Tweed Elegance dễ dàng phối hợp cùng váy, quần jeans hay quần âu, thể hiện phong cách thời trang kiểu mới và phù hợp cho nhiều hoàn cảnh từ công sở đến các buổi gặp gỡ trang trọng.', '2024-10-15', 120, 11, NULL, NULL, NULL, NULL, '', NULL);
INSERT INTO `san_pham` VALUES (88, 'Little Tweed Jacket', 400000, 400000, '', 'Áo khoác Little Tweed Jacket là sự kế thừa vẻ tinh tế của chiếc áo khoác tweed cổ điển: cổ tròn, viền bằng vải vặn thừng khác màu, 2 nắp túi phía trước', '2024-10-15', 130, 11, NULL, NULL, NULL, NULL, 'Đen', NULL);
INSERT INTO `san_pham` VALUES (89, 'Áo vest Tweed Kose', 300000, 300000, '', 'Ánh nắng mùa thu, dù không còn chói chang, vẫn mang đến cảm giác ấm áp, nhẹ nhàng tựa như sự mềm mại và lãng mạn luôn hiện hữu bên trong mỗi người phụ nữ. Đây chính là nguồn cảm hứng chủ đạo cho những thiết kế tinh tế trong BST Muse of the Sun.\n\nMỗi thiết kế công sở hiện đại trên gam màu vàng nhạt của sắc thu mang đến cảm giác vừa ấm áp vừa dịu mắt, như tia nắng lấp lánh trên từng trang phục.\n\nÁo vest Tweed Kose là một thiết kế thanh lịch và hiện đại, mang đến vẻ ngoài sang trọng với chất liệu tweed cao cấp, bền bỉ. \n\nThiết kế cổ đức không chân mang đến sự tinh tế, mới mẻ, giúp chiếc áo vừa giữ được nét trang trọng của vest nhưng vẫn tạo cảm giác nhẹ nhàng, thoải mái cho người mặc. Độ dài ngang hông tôn dáng, cân đối và dễ phối đồ. Với kiểu dáng này, bạn có thể dễ dàng kết hợp áo vest với áo sơ mi, chân váy, quần tây hay quần jeans để tạo nên phong cách từ chuyên nghiệp đến thời trang đường phố.', '2024-10-15', 120, 11, NULL, NULL, NULL, NULL, 'Kẻ be sáng', NULL);
INSERT INTO `san_pham` VALUES (91, 'Apple iMac 27“', 43543, 44353, '', 'sfgf', '2024-10-19', 45, 8, NULL, NULL, NULL, NULL, 'Đỏ', NULL);

-- ----------------------------
-- Table structure for tin_tuc
-- ----------------------------
DROP TABLE IF EXISTS `tin_tuc`;
CREATE TABLE `tin_tuc`  (
  `tt_ma` int NOT NULL AUTO_INCREMENT,
  `tt_tieude` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `tt_hinhanh` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `tt_noidung` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `tt_thoigian` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `nv_ma` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`tt_ma`) USING BTREE,
  INDEX `nv_ma`(`nv_ma` ASC) USING BTREE,
  CONSTRAINT `tin_tuc_ibfk_1` FOREIGN KEY (`nv_ma`) REFERENCES `nhan_vien` (`nv_ma`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of tin_tuc
-- ----------------------------

SET FOREIGN_KEY_CHECKS = 1;
